import Header from "../../components/header"
import './ChatPage.css';

const ChatPage = () =>
{
	return (
		<div className="chat-page">
			<Header />
				<div className="chat-sidebar">
					<div className="search-channel">
						<div className="search-section">
							<i className="search-icon">üîç</i> {/* replace with your actual search icon */}
							<span>search channel</span>
						</div>
						<button className="add-channel">+</button>
					</div>
					<div className="channel-list">
						<div className="channel">
							<span className="channel-avatar">G</span>
							<span className="channel-name">general</span>
						</div>
						{/* repeat the above 'channel' div for each channel */}
					</div>
				</div>
				<div className="chat-content">
					{/* your chat content goes here */}
				</div>
		</div>
	);
};

export default ChatPage;

import React from 'react';
import { Link } from 'react-router-dom';
import './Sidebar.css';

const Sidebar = () =>
{
    return (
        <div className="sidebar">
            <div className="sidebar-section">
                <h2>CHANNELS</h2>
                <div className="sidebar-icons">
                    <button className="sidebar-icon">üîç</button>
                    <button className="sidebar-icon">‚ûï</button>
                </div>
            </div>
            <div className="sidebar-section">
                <h2>DIRECT MESSAGES</h2>
                <button className="sidebar-icon">‚ûï</button>
            </div>
            <Link to="/chat/blabla" className="sidebar-default-channel">#blabla</Link>
        </div>
    );
}

export default Sidebar;
